import React from "react";

class NavBar extends React.Component {
  state = {
    array: [
      {
        type: "Stays",
        icon: "fa-bed",
        active: true,
      },
      {
        type: "Flights",
        icon: "fa-plane",
        active: false,
      },
      {
        type: "Car rentals",
        icon: "fa-car",
        active: false,
      },
      {
        type: "Attractions",
        icon: "fa-bed",
        active: false,
      },
      {
        type: "Airport taxis",
        icon: "fa-taxi",
        active: false,
      },
    ],
  };
  arrayList = (job) => {
    this.setState({
      array: [...this.state.array, job],
    });
  };
  render() {
    {
      array.map((item, index) => {
        return <div>{item.type}</div>;
      });
    }
  }
}
export default NavBar;
